                    <DownLoudBox className="downloud"><Link text="An IDC study shows that"/></DownLoudBox>
                    <DownLoudBox className="downloud"><Link text="An IDC study shows that"/></DownLoudBox>
                    <DownLoudBox className="downloud"><Link text="An IDC study shows that"/></DownLoudBox>
                     </Item>
                     <ArrowBox className="arrow3"><Link text="Explore the docs"/></ArrowBox>
                </Box>
                <ImageDeveloper/>
            </InContainer>
        </Container>
    );
  }
}
export default Developer;
